import React from 'react'
import FlightItem from './FlightItem'

const FlightList = ({ Flights }) => {

  const allFlights = flights.map((flight, index) => {
    <FlightItem key={index} flight={flight} />
  })




  return (

    <div>
    <h2>FlightList</h2>
    {allFlights}

    </div>
  )

}

export default FlightList;
